import './App.css';

function App() {
  return (
    <div className="App">
       <div id="card-title">
        <h2>LOGIN</h2>
        <div class="underline-title"></div>
      </div>
      <form>
        <label style={{paddingTop:"13px"}}>
            User Name
          </label>
        <input />
        <div></div>
        <label style={{paddingTop:"22px"}}>Password
          </label>
        <input />
        <div ></div>
        <input type="submit" name="submit" value="LOGIN" />

      </form>
    </div>
  );
}

export default App;
